import React, {useState} from 'react';
import Modal from 'react-bootstrap/Modal';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../../App.css';
import './Pages.css';

export default function BoardOfDirectors()
{
	return (
		<div className='contentArea'>
			<Container>
				<Row className='headerRow'>
					<Col data-aos='fade-left' data-aos-duration='500'>
						<h1 className='fw-bold'>Board of Directiros</h1>
					</Col>
				</Row>
				<br/>
				<Row id="modalRow">
					<Col lg={3} data-aos='fade' data-aos-duration='500' data-aos-delay='150'>
						<div id="pane1" className='enterpriseTechnologyPane'>
						</div>
					</Col>
					<Col lg={3} data-aos='fade' data-aos-duration='500' data-aos-delay='300'>	
						<div id="pane2" className='enterpriseTechnologyPane'>
						</div>
					</Col>
					<Col lg={3} data-aos='fade' data-aos-duration='500' data-aos-delay='450'>
						<div id="pane3" className='enterpriseTechnologyPane'>
						</div>
					</Col>
					<Col lg={3} data-aos='fade' data-aos-duration='500' data-aos-delay='600'>
						<div id="pane4" className='enterpriseTechnologyPane'>
						</div>
					</Col>
				</Row>
			</Container>
		</div>

	);
}
